"3" = Honoraria;
"4" = Gift;
"5" = Entertainment;
"6" = Food and Beverage;
"7" = Travel and Lodging;
"8" = Education;
"9" = Charitable Contribution;
"10" = Royalty or License;
"11" = Current or prospective ownership or investment interest; 
"12" = Compensation for serving as faculty or as a speaker for a non-accredited and noncertified continuing education program; 
"13" = Compensation for serving as faculty or as a speaker for an accredited or certified continuing education program; 
"14" = Grant; 
"15" = Space rental or facility fees (teaching hospital only);
